window.bookSummaryJSON = "In barren desert lands and seedy spaceports...in vast underwater cities and in the blackest depths of space...unfolds a tale of good and evil, of myth and magic, of innocence and power. At last the saga that captures the imagination of millions turns back in time to reveal its cloaked origins, the start of a legend, the story of <i>Star Wars</i>. Based on the screenplay by George Lucas, this novel by master storyteller Terry Brooks probes the depths of one of the greatest tales of our time, providing rich detail and insight into the minds and motives of the characters and shedding bold new light on Lucas' brilliant creation."; 
